          ))

        }

        <GenreCard name={""} popularArtists={[]} upcomingEvents={[]} topSongs={[]} eventsPriceRange={[]}></GenreCard>
        <GenreCard ></GenreCard>
        <GenreCard ></GenreCard>
        <GenreCard ></GenreCard>
        <GenreCard ></GenreCard>

      </div>

    </>

  );
}

export default Genre;
